notes:
- These pages are intended as an API Reference.
- For a deeper explanation of how different parts of Binary Ninja work, explanations
  of concepts, or if youre new to Binary Ninja, youll want to check out our User
  Guide.
- Animation is a helper class for setting up UI animations.
- Workflows are represented as Directed Acyclic Graphs (DAGs), where each node corresponds
  to an Activity (an individual analysis or action).
- The max_instr_length property of an architecture is not necessarily representative
  of the maximum instruction size of the associated CPU architecture.
- This class is meant to be used by Architecture plugins only
- Setting the prefetch_limit excessively high can result in high memory utilization.
- Handlers provided by the user should aim to limit the amount of processing within
  the callback.
- This method is intended for use by architecture plugins only.
- Users should initialize BinaryDataNotification with specific callbacks of interest
- A constant is considered used if a line in the linear view expansion of the given
  function graph type contains a token with a value that matches that constant.
- This does not search for raw bytes/data in the binary.
- Uses OAuth2 with refresh token  requires setup of connected app in api
- Some objects like Contact may return nulls in deeply nested fields
- This method may be overridden by custom BinaryViews. Use add_auto_segment to provide
  data without overriding this method.
- This method must not be called directly.
- The BinaryViewType object should not be directly instantiated.
- The MemoryMap object allows for the addition of multiple, arbitrary overlapping
  regions of memory.
- The demangling process may create unresolved named types as empty structures.
- The call to demangle should not cause side-effects in the view.
- Helper class for scripts to make use of a license checkout in a scope.
- Class FileMetadata represents the file being analyzed by Binary Ninja.
- Responsible for opening, closing, creating the database (.bndb) files.
- In the current implementation, only graphs that have a single start node where all
  other nodes are reachable from outgoing edges can be rendered correctly. This describes
  the natural limitations of a control flow graph, which is what the rendering logic
  was designed for. Graphs that have nodes that are only reachable from incoming edges,
  or graphs that have disjoint subgraphs will not render correctly. This will be fixed
  in a future version.
- In the current implementation, only graphs that have a single start node where all
  other nodes are reachable from outgoing edges can be rendered correctly.
- Graphs that have nodes that are only reachable from incoming edges, or graphs that
  have disjoint subgraphs will not render correctly.
- Requires setup of connected app in binary.ninja
- Some objects may return nulls in deeply nested fields
- Returns a list of tuples containing the name of the operand, the operand, and the
  type of the operand.
- Useful for iterating over all operands of an instruction and sub-instructions.
- This function should ONLY be called as a part of a lifter or workflow. It will otherwise
  not do anything useful as analysis will not be running.
