- All settings in the default settings schema are rendered with UI elements in the
  Settings View of Binary Ninja UI.
- Allowing setting overrides is an important feature and Binary Ninja accomplishes
  this by allowing one to override a setting at various levels.
- This object is a passive object. Any changes you make to it will not be reflected
  in the core and vice-versa.
- Workflows are represented as Directed Acyclic Graphs (DAGs), where each node corresponds
  to an Activity.
- Welcome to the Workflow Orchestrator. Type 'help' to list available commands.
