- 'ILException: Exception raised when IL operations fail'
- 'ProjectException: Exception raised when project operations fail'
- 'RelocationWriteException: Exception raised when a relocation fails to apply'
- 'REQUEST_LIMIT_EXCEEDED: Throttle API calls or reduce frequency'
- 'QUERY_TIMEOUT: Break down filters or add selectivity'
- '401 Unauthorized: Recheck OAuth scopes or token expiration'
